    /**
     * for the CONSTANT_TIME case,
     *
     * @param FT
     * @return
     */
    public double fromFiltration(Filtration FT) {
        FiltrationFunction numeratorFunction = new F_sum_tBtDt() {

            @Override
            public double evaluate(int t) {
                double Bt = FT.B(t);
                return Bt - sum_BtDt - 12 * (FT.T(t) - 0.5) * sum_tBtDt;
            }
        };

        FiltrationFunction denominatorFunction = new F_sum_tBtDt() {

            @Override
            public double evaluate(int t) {
                double Bt = FT.B(t);
                return pow(Bt - sum_BtDt - 12 * (FT.T(t) - 0.5) * sum_tBtDt, 2);
            }
        };

        return ADFAsymptoticDistribution.ratio(numeratorFunction, denominatorFunction, FT);
    }

    public double fromRegression(Vector y, Matrix X) {
        Matrix bindedX = CreateMatrix.cbind(X, new DenseMatrix(R.seq(1, y.size(), 1.), y.size(), 1));
        LMProblem problem = new LMProblem(y, bindedX, true);
        return ADFFiniteSampleDistribution.testStat(problem);
    }
